import axios from "axios";

export const getIdRoom = async user =>
    axios.get("http://localhost:4000/token/", {
      params: {
        user
      }

    });

export const getToken = async user =>
  axios.get("http://localhost:4000/token/", {
    params: {
      user
    }

  });
